Different Projections on Resource and Item Endpoints in Python Eve<p>I'm fairly new to RESTful API. So please bear with my ignorance.</p>

<p>Suppose I have a MongoDB collection <code>foobars</code> with some documents. The structure is like:
<code>[{'_id': 1, 'foo': 1, 'bar': 1}, {'_id': 2, 'foo': 2, 'bar': 2},...]
</code></p>

<p>I want to set up two endpoints:</p>

<ul>
<li><code>GET /api/foobars</code>,
this should return a list of <code>_id</code>, i.e <code>[{'_id': 1}, {'_id': 2}]</code>.</li>
<li><code>GET /api/foobars/1</code>, this should return a single document whose <code>'_id'==1</code>, i.e <code>{'_id': 1, 'foo': 1, 'bar': 1}</code>.</li>
</ul>

<p>I set up a projection in the domain</p>

<pre><code>DOMIAN = {
    'foobars': {
        'schema': {...},
        'datasource': {
            'projection': {'_id': 1}
        }
    }
}
</code></pre>

<p>This works as expected on the Resource level. But on Item level it still only returns the projected fields.</p>

<p>How should I define the projection properly? Should I set multiple endpoints for the same resource? Thanks!</p>

