Watch document creation with MongoDB Streams<p>I'd like to use MongoDB streams to trigger an event each time a specific kind of data is inserted into a collection.</p>

<p>I've already found something roughly similar to what I'm looking for but that's only working for change streams and not insertions.</p>

<p>Any idea of how I can get that done?</p>

<p>I'm using <strong>Mongodb</strong> driver with <strong>Nodejs</strong> to get that done so my code would be something like that:</p>

<pre><code>const MongoClient = require('mongodb').MongoClient;

const uri = 'mongodb://localhost:27017/?replicaSet=rs0';
MongoClient.connect(uri, function(err, client) {

const db = client.db('mydb');

// Connect using MongoClient
var filter = [{
    $match: {
        $or: [
            { $or: [{"receipt.receiver": "newdexpocket"}, {"act.account": "newdexpocket"}] }]
    }
}];

var options = { fullDocument: 'updateLookup' };
db.collection('somecollection').watch(filter, options).on('create', data =&gt; 
  {
    console.log(data);
  });
});
</code></pre>

<ul>
<li>Do I need to specify an <code>operationType</code> in the filter?</li>
<li>I also need to get the fullDocument but obvisouly the <code>updateLookup</code> isn't the right tool, what should I use?</li>
<li>What are the options I can use for the <code>on</code> event? I've used <code>create</code> but I'm not even sure it exists, does it?</li>
</ul>

<p>Sorry about all these questions but I'm struggling to find some answers in the official doc. </p>

<p>SOLUTION:</p>

<p>Beware not to forget <code>fullDocument</code> in your request ;-)</p>

<pre><code>function watch_insert(con, db, coll) {
  console.log(new Date() + ' watching: ' + coll);

  const insert_pipeline = [ { $match:
                    { 
                        operationType: 'insert',
                        $or: [
                            { "fullDocument.receipt.receiver": "newdexpocket" },
                            { "fullDocument.act.account": "newdexpocket" }
                        ]
                    }
                }];

  con.db(db).collection(coll).watch(insert_pipeline)
    .on('change', data =&gt; {
      console.log(data)
    });
}

async function run(uri) {
    try {
        con = await MongoClient.connect(uri, {"useNewUrlParser": true});
        watch_insert(con, 'EOS', 'action_traces');
    } catch (err) {
        console.log(err);
    }
}
</code></pre>

