Mongoose trying to handle pre-save errors using promises<p>I'm trying to use pre-save to handle user or email exists error and I can't get it to work. If I comment out my pre-save block everything works fine but it returns the default mongoose error in case of duplicate because my schema uses Unique.</p>

<p>I would like to check for username &amp; email unique and send one message containing true or false so that I can handle both at the same time in my frontend. (Btw this is an Express Restful API)</p>

