<p>Here is my current setup :</p>

<p>My register method called on my post register route when request passes all middlewares etc. ValidateRegisterForm does some validations on the datas and if everything is fine, hashes the password and pass all datas to createUser, else it sends errors.</p>

<pre><code>public register(req, res){
   validateRegisterForm(req.body).then(data =&gt; {
    createUser(data).then(() =&gt; {
      res.send({status: 201});
    }).catch(err =&gt; {
      res.send(err);
    })
  }).catch(err =&gt; {
      res.send(err);
    });
}
</code></pre>

<p>My createUser method :</p>

<pre><code>export const createUser = (data) =&gt; {
  return new Promise( async (resolve, reject) =&gt; {
     const userData = JSON.parse(data);
     const newUser = new User(userData);
     await newUser.save()
       .then(() =&gt; resolve())
       .catch(err =&gt; reject(err))
  });
};
</code></pre>

<p>And my User schema with the pre-save :</p>

<pre><code>userSchema.pre('save', () =&gt; {
